import Typewriter from "typewriter-effect";

const App = () => {
  return (
    <Typewriter
      options={{
        loop: false,
        delay: 65,
        autoStart: true,
        cursor: "█",
        strings: [""],
      }}
      onInit={(typewriter) => {
        typewriter
          .typeString("<span id='type'>Hi! </span><br>")
          .pauseFor(300)
          .typeString("<span id='type'> I'm Yassine,</span>")
          .pauseFor(100)
          .typeString("<span id='type'> a student,</span>")
          .pauseFor(100)
          .typeString("<span id='type'> developer and hacker.</span><br/>")
          .pauseFor(500)
          .typeString(
            "<span id='type'>I love tinkering with different technologies and exploring their inner workings.</span><br/>"
          )
          .pauseFor(300)
          .typeString(
            "<span id='type'>My interests include CTF challenges and competitive programming.</span><br/>"
          )
          .pauseFor(300)
          .typeString(
            "<span id='type'>Feel free to check my work.</span><br/>"
          );
      }}
    />
  );
};

export default App;
